response.about:
• мыслить позитивно; 
• расширять свой кругозор; 
• заниматься спортом; 
• не сидеть, сложа руки; 
• постоянно самосовершенствоваться; 
• ценить свое время; 
• помогать близким; 
• много учиться; 
• любить и быть любимым.

должны быть следующие вещи:
- четкая система жизненных ценностей и ориентиров (жизненная философия);
- огромное желание (безудержное) создать лучшую жизнь для себя и своих близких или других людей;
- настоящая большая (очень) цель, которую практически невозможно достичь.

Я ужас, летящий на крыльях ночи! Я страх, пронзающий ночь! Я десница судьбы!
 Вещи, в которых я на удивление хорош:
1. Не отвечать на сообщения;
2. Вечно на что-то надеяться;
3. Грустить;
4. Неловко молчать;
5. Выводить людей из себя;
6. Спать.
